Огромный дом 161 кв.м., с потрясающей планировкой, 7 комнат (2 зала и 5 спален):
1 этаж:
- отдельно выделена обеденная группа – большая столовая (13.6 кв.м.), соединенная с кухней ( 6,6 кв.м.), окна в столовой и в кухне; санузел смежный (3 кв.м.) с окном;
- 2 зала: один очень большой (26 кв.м.) с 3 окнами, непроходной; второй зал проходной (15 кв.м.) с хорошей планировкой для расстановки мебели, с него выходы в 2 спальни;
- 2 спальни по 14 кв.м: в каждой спальне по 2 окна, двухстворчатые двери.

2 этаж:
- 3 спальни: огромнейшая светлая спальня (25кв.м.) , в ней 2 больших окна; 2 маленьких спальни (по 9 кв.м.);
- достаточно большой коридор, куда выходит лестница с первого этажа;
- 2 кладовки.
Практически вся площадь дома полезная и приспособлена для нормальной расстановки мебели, все комнаты просторные, много больших окон и высокие потолки, двухстворчатые деревянные двери, толстые кирпичные стены. Очень красиво выйдет если сделать интерьер в скандинавском стиле, все исходные параметры подходят.
